import React from 'react'

function Cart(props) {
  return (
    <div>
      <h1>Cart</h1>
      {props.cartProducts.map(item => (
        <div>
          <img src={item.image}/>
          <h5>{item.title}</h5>
        </div>  
      ))}
    </div>
  )
}

export default Cart
